import React, { useState, useEffect } from 'react';
import './instagram.css';

function Instagram () {
  const [items, setItems] = useState([]);

  useEffect(() => {
    fetchItems();
  }, []);
  const fetchItems = async () => {
    const data = await fetch('https://private-anon-097fe242aa-codemocracy.apiary-mock.com/topics');
    const items = await data.json();
    setItems(items);
  }
  console.log(items);

  return (
    <>
      <div className='instagram'>
        <h4>instagram</h4>
      </div> 
      <div>
        <h2>Discount Settings</h2>
        <p>Percentage</p>
        <input></input>
      </div>
      {
        items.map(item => <p>{item.title}</p>)
      }
    </>
  )
}

export default Instagram;
